import React, { useEffect, useState } from "react";

export default function Hero() {
  const slides = [
    {
      url: "https://images.unsplash.com/photo-1500530855697-b586d89ba3ee?q=80&w=1600&auto=format&fit=crop",
      headline: "Discover Amazing Events",
      subtitle: "Find and attend the best events happening around you",
      cta: "Explore Events",
      gradient: "linear-gradient(135deg, rgba(59, 130, 246, 0.9), rgba(30, 64, 175, 0.9))"
    },
    {
      url: "https://images.unsplash.com/photo-1515165562835-c3b8c20b2e68?q=80&w=1600&auto=format&fit=crop",
      headline: "Create Your Event",
      subtitle: "Organize and share your events with the world",
      cta: "Start Creating",
      gradient: "linear-gradient(135deg, rgba(6, 182, 212, 0.9), rgba(8, 145, 178, 0.9))"
    },
    {
      url: "https://images.unsplash.com/photo-1492684223066-81342ee5ff30?q=80&w=1600&auto=format&fit=crop",
      headline: "Connect & Network",
      subtitle: "Meet like-minded people and build lasting connections",
      cta: "Join Now",
      gradient: "linear-gradient(135deg, rgba(16, 185, 129, 0.9), rgba(5, 150, 105, 0.9))"
    },
  ];

  const categories = [
    { icon: "bi-calendar-event", label: "Halloween", color: "#ef4444" },
    { icon: "bi-music-note-beamed", label: "Music", color: "#06b6d4" },
    { icon: "bi-moon-stars", label: "Nightlife", color: "#3b82f6" },
    { icon: "bi-masks", label: "Performing & Visual", color: "#f59e0b" },
    { icon: "bi-heart", label: "Dating", color: "#ec4899" },
    { icon: "bi-controller", label: "Hobbies", color: "#8b5cf6" },
    { icon: "bi-briefcase", label: "Business", color: "#10b981" },
    { icon: "bi-cup-straw", label: "Food & Drink", color: "#f97316" },
  ];

  const [idx, setIdx] = useState(0);
  const next = () => setIdx((i) => (i + 1) % slides.length);
  const prev = () => setIdx((i) => (i - 1 + slides.length) % slides.length);

  useEffect(() => {
    const id = setInterval(next, 6000);
    return () => clearInterval(id);
  }, []);

  return (
    <>
      <section className="hero-carousel position-relative">
        <img src={slides[idx].url} alt="hero" className="w-100 hero-slide" />
        <div 
          className="hero-overlay"
          style={{ background: slides[idx].gradient }}
        >
          <div className="container">
            <div className="row justify-content-center text-center">
              <div className="col-lg-8">
                <h1 className="display-3 fw-bold mb-4">{slides[idx].headline}</h1>
                <p className="lead mb-4 fs-4">{slides[idx].subtitle}</p>
                <button className="btn btn-light btn-lg px-5 py-3">
                  {slides[idx].cta}
                </button>
              </div>
            </div>
          </div>
        </div>
        <button className="hero-nav hero-prev" onClick={prev} aria-label="Previous">‹</button>
        <button className="hero-nav hero-next" onClick={next} aria-label="Next">›</button>

        {/* Slide Indicators */}
        <div className="position-absolute bottom-0 start-50 translate-middle-x mb-4">
          <div className="d-flex gap-2">
            {slides.map((_, i) => (
              <button
                key={i}
                className={`btn rounded-circle p-0 ${i === idx ? 'bg-white' : 'bg-white bg-opacity-50'}`}
                style={{ width: '12px', height: '12px' }}
                onClick={() => setIdx(i)}
                aria-label={`Go to slide ${i + 1}`}
              />
            ))}
          </div>
        </div>
      </section>

      {/* Enhanced Categories */}
      <div className="container-fluid px-4">
        <div className="row justify-content-center">
          <div className="col-12">
            <div className="categories-scroll d-flex gap-3 justify-content-center">
              {categories.map((category) => (
                <div key={category.label} className="text-center category-item">
                  <div className="category-circle mx-auto">
                    <i className={`bi ${category.icon}`} style={{ color: category.color }}></i>
                  </div>
                  <div className="category-label">{category.label}</div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
